import React from 'react';
import { wrapComponent } from 'react-snackbar-alert';

const Gif = wrapComponent(({ url, createSnackbar }) => {
  let handleCopyUrl = (url) => {
    createSnackbar({
      message: "Hello!"
    });
  }

  return (
    <li className="gif-wrap">
      <img src={url} alt="" onClick={handleCopyUrl(url)} />
    </li>
  );
});

